	add("spuria", "{\"term\":\"spuria\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From the Latin \u0027spuria\u0027 the nominative neuter plural form of \u0027spurius\u0027 whence \u0027spurious\u0027 compare \u0027trivia\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Spurious things; especially, a counterfeit or forged written work or one of doubtful attribution\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1790\u0027\u0027: \u0027The Gentleman’s Magazine\u0027, volume 67, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dPV7PAAAAMAAJ\u0026amp;pg\u003dPA292\u0026amp;dq\u003dspuria\u0026amp;hl\u003den\u0026amp;ei\u003dNQNxTM7fHIqo4AbmjvneCA\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d13\u0026amp;ved\u003d0CHAQ6AEwD\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dspuria\u0026amp;f\u003dfalse page 292]\u0026lt;/span\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The laſt will and teſtament of \u0027Grunnius\u0027, a Roman pig, publiſhed among Gruter’s \u0027\u0027\u0027Spuria\u0027\u0027\u0027, betrays not more evident marks of impoſition\", \"priority\":4}]}, \"synonyms\":{}}");

	add("sputcheon", "{\"term\":\"sputcheon\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"metal lining of a scabbard\u0027s mout\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"page \u003d 345 pageurl \u003d http://books.google.com/books?id\u003dFMeUuiFfZacC\u0026amp;pg\u003dPA345\u0026amp;dq\u003dsputcheon passage \u003d She held her mouth slitted open in anguish so that in Inman\u0027s mind it resembled the \u0027\u0027sputcheon\u0027\u0027 to a sword scabbard\", \"priority\":2}]}, \"synonyms\":{}}");

	add("sputnik", "{\"term\":\"sputnik\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Russian\"], \"text\":\"From Russian \u0027спу́тник\u0027 (fellow traveller) from \u0027с-\u0027 (with, together) + \u0027пу́тник\u0027 (traveller) from \u0027путь\u0027 (way, journey) + agent suffix \u0027-ник\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a series of Soviet robotic space satellites, especially the first one in 1957\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027 January 25, Barack Hussein Obama II, Jon Favreau (speechwriter), \u0027State of the Union\u0027, United States House of Representatives\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Half a century ago, when the Soviets beat us into space with the launch of a satellite called \u0027\u0027Sputnik\u0027\u0027¸ we had no idea how we’d beat them to the moon. The science wasn’t there yet. NASA didn’t even exist. But after investing in better research and education, we didn’t just surpass the Soviets; we unleashed a wave of innovation that created new industries and millions of new jobs. This is our generation’s \u0027\u0027Sputnik\u0027\u0027 moment\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any artificial satellite\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1958\u0027\u0027, Clinton P. Anderson, statement on the Senate floor, quoted in, \u0027Legislative history: Saline water conversion act\u0027, page 78\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"With this program, we could bring water to the Middle East. We could rebuild some of our sagging esteem in that part of the world; we could insure that in this area at least we would have our \u0027\u0027sputniks\u0027\u0027 abreast the Russians\u0027, and we could do our own economy a priceless good turn\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1958\u0027\u0027 October 23, Gemnius, \u0026quot;It seems to me\u0026quot;, \u0027New Scientist\u0027, page 112\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"This is but one of the facts which should demonstrate to those who would build British \u0027\u0027sputniks\u0027\u0027 that such extravagances will be a disservice to the whole country until the supply of scientists has been multiplied many times\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1965\u0027\u0027, \u0027The Contemporary\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Of course, long before this reliable systems of meteorological \u0027\u0027sputniks\u0027\u0027, world-wide television \u0027\u0027sputniks\u0027\u0027, navigation \u0027\u0027sputniks\u0027\u0027, etc., will be created\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1971\u0027\u0027, \u0027Shenandoah\u0027, volumes 9-10, page\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"In Britain, before we had the news of the launching of the Russian and just now the American \u0027\u0027sputniks\u0027\u0027, we learned the news that American planes carrying H-bombs, which they could deliver on Russia at very short notice, are continuously in the air\", \"priority\":12}]}, \"synonyms\":{}}");

	add("sputter", "{\"term\":\"sputter\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"German\", \"English\", \"middle english (1100-1500)\", \"West Frisian\", \"low german\", \"Dutch\", \"saterfriesisch\"], \"text\":\"Probably representing Middle english (1100-1500) {{m|enm|*sputren}}, {{m|enm|*sputrien}}, a frequentative form of \u0027sputen\u0027 (to spout, vomit) equivalent to {{suffix|spout|er|lang\u003den}}. Cognate with Saterfriesisch \u0027spüttern\u0027 (to inject, spray, splash) West frisian \u0027sputterje\u0027 (to sputter) Dutch \u0027sputteren\u0027 (to sputter) Low german \u0027sputtern\u0027 \u0027spruttern\u0027 (to sprinkle) German \u0027sprudeln\u0027 (to spout, squirt) Compare {{l|en|splutter}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Moist matter thrown out in small detached particles; also, confused and hasty speech\", \"priority\":1}]}, \"synonyms\":{}}");

